import Logo from "../../assets/images/rae-chastain-logo.png";

const Navigation = () => {
    const navItems = [
        {
            label: "Books",
            link: "/home"
        },
        {
            label: "Illustrations",
            link: "/illustrations"
        },
        {
            label: "Blog",
            link: "/blog"
        },
        {
            label: "About",
            link: "about"
        },
        {
            label: "Contact",
            link: "contact"
        }
    ]

    return (
        <nav>
            <div>
                <img src={Logo} alt="rae chastain's logo" />
            </div>
        </nav>
    );
};

export default Navigation;
